import React, { Component } from 'react';
import ProductCards from '../components/product-cards';

class CategoryPage extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <p>this is CategoryPage</p>
                <ProductCards />
            </div>
        )
    }
}

export default CategoryPage
